import React from "react";
import Box from '@mui/material/Box';
import { Typography } from "@mui/material";
import TextField from "@mui/material/TextField";
import Button from '@mui/material/Button';

const LoginForm = ({onUsernameChange, onPasswordChange, onSubmitClick}) => {
    return (    
        <Box 
            height={500}
            width={500}
            my={4}
            mx={55}
            display="flex"
            alignItems="center"
            gap={4}
            p={2}
            sx={{ 
                    border: '2px solid grey', 
                    fontFamily: 'Times',
                    backgroundColor: "white",
                }}
        >
            <div className="login-contents">
                <Typography
                    variant="h1"
                    alignItems="center"
                    sx={{
                        fontFamily: 'Times',
                        }}
                >
                    Buzz
                </Typography>
                <div className="input-container">
                    <TextField id="outlined-basic" label="Username" variant="outlined" onChange={(value) => onUsernameChange(value)}/>
                    <TextField id="outlined-basic" label="Password" variant="outlined" onChange={(value) => onPasswordChange(value)}/>
                </div>
                <Button variant="outlined" onClick={onSubmitClick}>Outlined</Button>
            </div>
        </Box>
    )
}

export default LoginForm
